import React from "react";

class InputSearchComponent extends React.Component {
  render() {
    return (
      <div className="InputSearchComponent">
        <form className="form-inline">
          <div className="md-form form-lg">
            <input
              value={this.props.value}
              onChange={this.props.onChange}
              type="text"
              id="inputLGEx"
              className="form-control form-control-lg"
            />
            <label htmlFor="inputLGEx">Search</label>
          </div>
          <button type="submit" className="btn btn-primary btn-md mt-0">
            Search
          </button>
        </form>
      </div>
    );
  }
}

export default InputSearchComponent;
